package com.example.demofetchtypejpa.entity;import jakarta.persistence.*;import lombok.Data;import java.util.UUID;@Data@Entity(name = "storeProduct")@Table(name = "store_product")public class StoreProductEntity {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private UUID id;    @Column(name = "store_id")    private Integer storeId;    @MapsId("productId")    @ManyToOne    @JoinColumn(insertable = false, updatable = false)    private ProductEntity productEntity;}